import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import ListUserComponent from "./component/rubric/ListRubricComponent";
import AddUserComponent from "./component/rubric/AddRubricComponent";
import EditUserComponent from "./component/rubric/EditRubricComponent";

function App() {
  return (
      <div className="container">
          <Router>
              <div className="col-md-6">
                  <h1 className="text-center" style={style}>React User Application</h1>
                  <Switch>
                      <Route path="/" exact component={ListRubricComponent} />
                      <Route path="/users" component={ListRubricComponent} />
                      <Route path="/add-user" component={AddRubricComponent} />
                      <Route path="/edit-user" component={EditRubricComponent} />
                  </Switch>
              </div>
          </Router>
      </div>
  );
}

const style = {
    color: 'red',
    margin: '10px'
}

export default App;
